cssText._value:
body {
	background-position: right top; width: 100%; background-image: url("/world.png"); background-repeat: no-repeat; background-clip: border-box; background-color: rgb(238, 238, 238);
}
th , td {
	padding: 5px 10px; border: 1px solid rgb(164, 165, 166); border-image: none; vertical-align: top;
}
td span {
	margin-right: 3px;
}
table {
	background: white; border-collapse: collapse;
}
.small {
	color: rgb(90, 90, 90); font-size: 0.8em; font-weight: 100;
}
pre {
	white-space: pre-wrap;
}
